oad/c_fill,h_200,w_300/ucmzhj2zteyqo43rdbnc"}, {"date_added": "2025-01-17T18:12:12.006280", "description": "C\u0027est une fleur de montagne appartenant \u00e0 la famille des marguerites ou tournesols des Asteraceae. La plante pr\u00e9f\u00e8re les endroits rocheux et calcaires situ\u00e9s entre 1 800 et 3 400 m\u00e8tres d\u2019altitude. ", "id": "862ee5af-a352-42c7-98db-57a3b6a723e6", "image_url": "https://res.cloudinary.com/dfuzvu8c5/image/upload/v1737133933/r4bhos0cjc5cr9hxvolf.jpg", "name": "Edelweiss", "thumbnail_url": "http://res.cloudinary.com/dfuzvu8c5/image/upload/c_fill,h_200,w_300/r4bhos0cjc5cr9hxvolf"}, {"date_added": "2025-01-17T18:13:30.275521", "description": "Cette petite primev\u00e8re pousse sur les sols rocailleux calcaires. Ses fleurs sont blanches ou rose p\u00e2le, \u00e0 gorge jaune ou rouge.", "id": "06cbf79b-fe07-4c51-aa49-2371cffdc5cb", "image_url": "https://res.cloudinary.com/dfuzvu8c5/image/upload/v1737134011/nn152gg64tymg1wrjwtz.jpg", "name": "Androsace velue", "thumbnail_url": "http://res.cloudinary.com/dfuzvu8c5/image/upload/c_fill,h_200,w_300/nn152gg64tymg1wrjwtz"}];
if (flowers && flowers.length > 0) {
    const sidebar = document.querySelector('.sidebar');
    flowers.forEach(flower => {
        const thumbnail = createFlowerThumbnail(flower);
        sidebar.appendChild(thumbnail);
    });

    // Afficher la première fleur par défaut
    showFlower(flowers[0]);
}

// Gestion du formulaire d'ajout
document.getElementById('addFlowerForm').addEventListener('submit', function(event) {
    event.preventDefault();
    const formData = new FormData(this);

    fetch('/add_flower', {
        method: 'POST',
        body: formData
    })
    .then(response => {
        if (!response.ok) {
            throw new Error('Network response was not ok');
        }
        return response.json();
    })
    .then(flower => {
        const sidebar = document.querySelector('.sidebar');
        const thumbnail = createFlowerThumbnail(flower);
        sidebar.appendChild(thumbnail);

        // Réinitialiser le formulaire et fermer le modal
        this.reset();
        hideAddFlowerForm();

        // Afficher la nouvelle fleur
        showFlower(flower);
    })
    .catch(error => {
        console.error('Error:', error);
        alert('Une erreur est survenue lors de l\'ajout de la fleur.');
    });
});

// Gestion du formulaire de modification
document.getElementById('editFlowerForm').addEventListener('submit', function(event) {
    event.preventDefault();
    const formData = new FormData(this);
    const flowerId = document.getElementById('editFlowerId').value;

    fetch('/edit_flower', {
        method: 'POST',
        body: formData
    })
    .then(response => {
        if (!response.ok) {
            throw new Error('Network response was not ok');
        }
        return response.json();
    })
    .then(flower => {
        const thumbnailDiv = document.querySelector(`[data-flower-id="${flowerId}"]`);
        if (thumbnailDiv) {
            const newThumbnail = createFlowerThumbnail(flower);
            thumbnailDiv.replaceWith(newThumbnail);
        }

        // Mettre à jour l'affichage principal
        showFlower(flower);

        // Réinitialiser le formulaire et fermer le modal
        this.reset();
        hideEditFlowerForm();
    })
    .catch(error => {
        console.error('Error:', error);
        alert('Une erreur est survenue lors de la modification de la fleur.');
    });
});

// Fermer les modals en cliquant en dehors
window.onclick = function(event) {
    const addModal = document.getElementById('addFlowerModal');
    const editModal = document.getElementById('editFlowerModal');
    if (event.target === addModal) {
        hideAddFlowerForm();
    }
    if (event.target === editModal) {
        hideEditFlowerForm();
    }
}

// Ajouter la navigation au clavier
document.addEventListener('keydown', function(e) {
    if (e.key === 'ArrowRight') {
        showNextFlower();
    } else if (e.key === 'ArrowLeft') {
        showPreviousFlower();
    }
});



